import React from "react";
import { useSelector } from "react-redux";
import Brief from "../../../components/brief";

const Artbash = () => {
    const artbash = useSelector((state) => state.work.work[0]);

    return (
        <>
            <Brief
                name='ArtBash 2023'
                work={artbash} 
                brief='Making '
            />
            <div>

            </div>
        </>
    );
};

export default Artbash;
